INSERT INTO `exames` VALUES (1,'Dias da semana-cor','dias-da-semana-cor','Domingo,Segunda-feira,Terça-feira,Quarta-feira,Quinta-feira,Sexta-feira,Sábado',1,'2018-09-10 00:00:00','Olá! A seguir você participará do teste Dias da semana-Cor. Na próxima tela você verá os nomes dos dias da semana, como “Quarta-feira” ou “Sábado”. Por favor, escolha para o nome apresentado na sua tela a cor que mais se aproxima da sua cor sinestésica.','21'),(2,'Meses-cor','meses-cor',NULL,1,'2018-09-10 00:00:00','Olá! A seguir você participará do teste Meses do ano-Cor. Na próxima tela você verá os nomes dos meses do ano, como “Fevereiro” ou “Dezembro”. Por favor, escolha para o nome apresentado na sua tela a cor que mais se aproxima da sua cor sinestésica.','36'),(3,'Grafema-cor','grafema-cor','A',1,'2018-09-10 00:00:00','Olá! A seguir você participará do teste Grafema-Cor. Na próxima tela você verá os grafemas, como o número “5”. Por favor, escolha para o grafema apresentado na sua tela a cor que mais se aproxima da sua cor sinestésica.','108');
