INSERT INTO `exames_escolher` VALUES (1,'Número-cor','Os números quando vistos, pensados ou ouvidos causam percepções de cores.',1),(2,'Letra-cor','As letras quando vistas, pensadas ou ouvidas causam percepções de cores.',1),(3,'Dias da semana-cor','Os nomes dos dias da semana quando vistos, pensados ou ouvidos causam percepções de cores.',1),(4,'Meses-cor','Os nomes dos meses do ano quando vistos, pensados ou ouvidos causam percepções de cores. ',1),(5,'Números chineses-cor','Os números chineses quando vistos, pensados ou ouvidos causam percepções de cores.',1),(6,'Sequências-localizações espaciais (Sequências como números, dias da semana ou meses). ','Sequências como números ou dias da semana possuem localizações específicas no espaço 3D ao seu redor.',1),(7,'Tons musicais-cor','Os tons musicais quando pensados ou ouvidos causam percepções de cores.',1),(8,'Acordes musicais-cor','Acordes musicais diferentes causam percepções de cores diferentes.',1),(9,'Instrumentos musicais-cor','Instrumentos musicais diferentes causam percepções de cores diferentes.',1),(10,'Caracteres chineses-cor','Os caracteres chineses quando vistos ou pensados causam percepções de cores.',1),(11,'Gosto-cor','Gostos causam percepções de cores. Por exemplo, o sabor de chocolate pode ser amarelo.',1),(12,'Cheiro-cor','Cheiros causam percepções de cores. Por exemplo, o cheiro de bolo de cenoura pode ser verde claro.',1),(13,'Dor-cor','Níveis diferentes de dor causam percepções de cores.',1),(14,'Personalidade-cor','Ver ou pensar em uma pessoa faz você perceber uma cor. ',1),(15,'Toque-cor','Experimentar sensações de toque de diferentes tipos, em diferentes partes do corpo, causam percepções de cores.',1),(16,'Temperatura-cor','Temperaturas causam percepções de cores. Por exemplo, tocar em água fria ou sentir a água morna do chuveiro causam percepções de cores.',1),(17,'Orgasmo-cor','Um orgasmo sexual causa percepções de cores.',1),(18,'Emoção-cor','Diferentes emoções, como alegria, melancolia causam percepções de cores.',1),(19,'Visão-som','Ver fotos ou cenas causam percepções de sons. ',1),(20,'Som-cheiro','Sons específicos causam odores específicos. Por exemplo, o barulho de água jorrando desperta o cheiro de uma rosa. ',1),(21,'Visão-cheiro','Objetos ou cenas causam percepções de cheiros.',1),(22,'Som-toque','Determinados sons causam sensações de toque. Por exemplo, ouvir um avião voando desencadeia a sensação de um toque específico.',1),(23,'Som-sabor','Determinados sons causam sensações de gosto. Por exemplo, o tique-taque de um relógio provoca um gosto amargo na boca.',1),(24,'Visão-sabor','Fotos, objetos ou cenas desencadeiam percepções de gostos.',1),(25,'Libras-cor','Os signos da língua brasileira de sinais causam percepções de cores.',1),(26,'Nome de pessoa-cor','Nome de pessoas quando lidos causam percepções de cores. Por exemplo, o nome Mariana pode ser associado à cor lilás.',1),(27,'Números-personalidade','Os números possuem personalidades bem definidas. Por exemplo, o número 5 é organizado e amigável.',1),(28,'Letras-personalidade','As letras possuem personalidades bem definidas. Por exemplo, a letra P é estudiosa e gentil.',1);
