/*!40000 ALTER TABLE `termo_compromisso` DISABLE KEYS */;
INSERT INTO `termo_compromisso` VALUES (1,'Termo de Consentimento Livre e Esclarecido ','Você está sendo convidado a participar de um questionário e de alguns testes on-line para sinestesia. Sua decisão de participar é voluntária e você pode se recusar a participar, ou escolher parar de participar a qualquer momento durante o teste. Você pode se recusar a responder a qualquer pergunta. Em outro momento, podemos entrar em contato com vocês para participarem de outros estudos, mas a participação continua sendo totalmente voluntária. Qualquer informação pessoal coletada durante este estudo permanecerá estritamente confidencial; nossos bancos de dados de computador são protegidos por senha e mantidos em um servidor seguro. Seu endereço de e-mail é mantido em sigilo e nunca é compartilhado com qualquer parte externa (a menos que você nos dê permissão por escrito). Todos os resultados serão publicados de maneira estatística, sem informações de identificação pessoal. Você não será pessoalmente identificado em nenhum relatório de publicações que resultem deste estudo. Apenas dados anônimos podem ser disponibilizados a pedido de outros pesquisadores. Na conclusão do teste, você será informado da sua pontuação e saberá se essa pontuação indica que você é sinestésico. Quando você terminar o teste, seus resultados entrarão armazenados de forma segura em nosso banco de dados. Por favor, sinta-se à vontade para nos enviar um e-mail [brendasouza@letras.ufc.br] caso você tenha alguma dúvida.Você não recebe nenhum benefício direto por estar neste estudo, no entanto este trabalho nos ajudará a entender melhor a condição da sinestesia. Você deve ter 18 anos ou ter uma autorização de um responsável para participar deste estudo. Você pode indicar seu consentimento clicando no botão Continuar. ');
/*!40000 ALTER TABLE `termo_compromisso` ENABLE KEYS */;

